    if mibBuilder.loadTexts: alcatelIND1GVRPMIB.setRevisionsDescriptions(('Fixed the Notifications to use MIB Module OID.0 as Notifications root.', 'The GVRP MIB defines a set of GVRP related management objects for VLANs and ports that support GARP VLAN registration protocol (GVRP). GVRP as a protocol provides mechanisms to dynamically learn and further propagate VLAN membership information across a bridged network, as recommended in standards IEEE Draft Std. P802.1Q-REV/D5.0 and 802.1D 2004 Editions. This GVRP MIB extends already existing AOS-REUSE IETF_Q_BRIDGE MIB which is based on RFC 2674 (Bridges with Traffic Classes, Multicast Filtering and Virtual LAN Extensions), to accomodate the proprietary behavior of the device and for defining objects as recommended by standards. This MIB comprises proprietary managed objects as well the objects required for conforming to the standards. However, the set of objects defined in this MIB, do not duplicate, nor conflict with any MIB object definitions defined in the IETF_Q_MIB.',))
