if mibBuilder.loadTexts: alaGvrpPortConfigRestrictedRegistrationBitmap.setDescription('An octet string of 4096 bits that defines the status of the restricted registration control for all VLAN(s) in the range from 1 to 4096. It defines whether VLAN(s) can be created in the system based on GVRP processing or only mapped to ports in case they have already been statically created in the system. The bitmap will only affect the GVRP processing if the Registrar Administrative Control alaGvrpPortConfigRegistrarMode value on the port is set normal registration (1). Each bit defines: 0= false, dynamic VLAN registration is not restricted 1= true, VLAN cannot be created in the system by GVRP processing. However, if this VLAN already exists in the system as a static VLAN, then it can be mapped to the receiving port')
